#Monograms
def monogram(text):
    import misc
    uppertext = text.upper()
    filteredtext = misc.filter(uppertext)
    frequencies = {}
    for char in filteredtext:
        if char in frequencies:
            frequencies[char] += 1
        else:
            frequencies[char] = 1
    return frequencies
#Bigrams
def bigram(text):
    import misc
    uppertext = text.upper()
    filteredtext = misc.filter(uppertext)
    frequencies = {}
    for index in range(len(filteredtext)-1):
        bigram = filteredtext[index:index+2]
        if bigram in frequencies:
            frequencies[bigram] += 1
        else:
            frequencies[bigram] = 1
    return frequencies
#Trigrams
def trigram(text):
    alphabet = "ABCDEFGHIJKLMNOPQRSTUVQXYZ"
    uppertext = text.upper()
    filteredtext = ""
    for char in uppertext:
        if char in alphabet:
            filteredtext += str(char)
        else:
            next
    frequencies = {}
    for index in range(len(filteredtext)-2):
        trigram = filteredtext[index:index+3]
        if trigram in frequencies:
            frequencies[trigram] += 1
        else:
            frequencies[trigram] = 1
    return frequencies
#Quadgrams
def quadgram(text):
    alphabet = "ABCDEFGHIJKLMNOPQRSTUVQXYZ"
    uppertext = text.upper()
    filteredtext = ""
    for char in uppertext:
        if char in alphabet:
            filteredtext += str(char)
       
    frequencies = {}
    for index in range(len(filteredtext)-3):
        quadram = filteredtext[index:index+4]

        if quadram in frequencies:
            frequencies[quadram] += 1
        else:
            frequencies[quadram] = 1
    return frequencies

