#Product Moment Correlation Coefficient(PMCC)
def pmcc_m(text):
    import math
    import misc
    alphabet = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'
    ct = text.upper()
    filteredtext = misc.filter(ct)
    fx = monogram(filteredtext)
    fy = {'L': 11216, 'O': 18639, 'R': 14020, 'D': 12534, 'F': 5691, 'T': 24681, 'H': 19247, 'E': 33435, 'I': 16317, 'S': 16029, 'A': 21589, 'N': 17644, 'V': 1734, 'B': 4300, 'Y': 5060, 'W': 6759, 'M': 5661, 'G': 7054, 'C': 6632, 'U': 7100, 'P': 5370, 'K': 3375, 'J': 601, 'Z': 172, 'Q': 175, 'X': 231}
    sigxy = 0
    sigx = 0
    sigy = 0
    sigxsquared = 0
    sigysquared = 0
    for i in range(26):
        try:
            sigxy += fx[alphabet[i]]*fy[alphabet[i]]
        except KeyError:
            sigxy += 0
        try:
            sigx += fx[alphabet[i]]
        except KeyError:
            sigx += 0
        try:
            sigy += fy[alphabet[i]]
        except KeyError:
            sigy += 0
        try:
            sigxsquared += fx[alphabet[i]]**2
        except KeyError:
            sigxsquared += 0
        try:
            sigysquared += fy[alphabet[i]]**2
        except KeyError:
            sigysquared += 0
    topright = (sigx*sigy)/26
    top = sigxy - topright
    bottomleft = sigxsquared-((sigx)**2)/26
    bottomright = sigysquared-((sigy)**2)/26
    bottom = math.sqrt(bottomleft*bottomright)
    pmccf = top/bottom
    return pmccf

